				["customStacks"] = "function()\n    if aura_env.count > 0 then return aura_env.count end\n    return nil\nend",
				["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
				["customName"] = "\n\n",
				["custom"] = "function(_,_,combatEvent,_,sourceGUID,sourceName,_,_,destGUID,destName,_,_,spellID)\n    local compTime = GetTime()\n    \n    -- imp died\n    if combatEvent == \"UNIT_DIED\" then\n        for index, value in pairs(aura_env.time) do\n            if destGUID == index then\n                aura_env.time[index] = nil\n                aura_env.count = aura_env.count - 1\n                \n                --print((\"Imp died. Count: |cff00ff00%d|r\"):format(aura_env.count))\n            end\n        end\n    end\n    -- implosioned\n    if combatEvent == \"SPELL_INSTAKILL\" then\n        for index, value in pairs(aura_env.time) do\n            if destGUID == index then\n                aura_env.time[index] = nil\n                aura_env.count = aura_env.count - 1\n                \n                --print((\"Impplosioned. Count: |cff00ff00%d|r\"):format(aura_env.count))\n            end\n        end\n    end    \n    -- imp summoned\n    if combatEvent == \"SPELL_SUMMON\" and sourceGUID == aura_env.pguid then\n        if spellID == 196273 or spellID == 196274 or spellID == 104317 or spellID == 196271 then\n            aura_env.time[destGUID] = compTime\n            aura_env.count = aura_env.count + 1\n            --print((\"Imp spawned. Count: |cff00ff00%d|r\"):format(aura_env.count))\n            return true\n        end\n    end\nend\n--based on Lockslap's http://www.curse.com/addons/wow/elvui-wildimps\n\n\n\n\n\n\n\n\n\n\n",
