				["custom"] = "function()\n    \n    local immolationBuffed,_,_,_,_,immolationDuration,immolationExpirationTime = UnitBuff(\"player\",\"Immolation Aura\")\n    \n    local metaBuffed,_,_,_,_,metaDuration,metaExpirationTime = UnitBuff(\"player\",\"Metamorphosis\")\n    \n    WeakAuras.MOONFUZZ_ANTONIDAS_EU.DH.PainGain = 0\n    \n    if not (metaBuffed or immolationBuffed) then\n        return false\n    end\n    \n    function AddRemainingGain(expiration,duration,totalGain)\n        local remaining = expiration - GetTime()\n        remainining = remaining < 0 and 0 or remaining\n        local remainingPainGain = (remaining / duration) * totalGain\n        WeakAuras.MOONFUZZ_ANTONIDAS_EU.DH.PainGain = \n        WeakAuras.MOONFUZZ_ANTONIDAS_EU.DH.PainGain + remainingPainGain\n    end\n    \n    if immolationBuffed then\n        AddRemainingPainGain(immolationExpirationTime, immolationDuration, 20)\n    end\n    \n    if metaBuffed then\n        AddRemainingPainGain(metaExpirationTime, metaDuration, 15 * 7)\n    end\n    \n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
